import axios from 'axios';

export const book = (user) => async dispatch => {

    const result= await axios.post('http://localhost:5000/meetings', {doc_id:"id_1",
                                                                        name:user.name,
                                                                        email:user.email,
                                                                        phno:user.phno,
                                                                    start_date:user.startDate,
                                                                    end_date:user.startDate   })

    dispatch({
        type: 'BOOK',
        payload: result.data
    });
}
